import './App.css';

import React, {Component} from 'react';
import navbar from "./components/navbar/navbar";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
        <Router>
            <switch>
                <Route path="/">
                    <navbar triggerText="Sign Up" />
                </Route>
            </switch>
        </Router>
    );
  }
}

export default App;
